a068714f-ce3b-4b38-89e1-f958d4d8842d	0	0	1. Cập nhật thường xuyên nhu cầu, yêu cầu tuyển dụng của các ngành nghề để đổi mới về nội dung và phương pháp giảng dạy. Nếu được môn học có thể mời các diễn giả, chuyên gia từ các công ty tham gia diễn thuyết, giao lưu 1,2 buổi/học kì để giúp môn học, lớp học có tính thực tế, tạo động lực cho sinh viên hơn.\r\n2. Đối với giảng viên kiêm nhiệm nhiều chức vụ cần có phương thức tính miễn giảm số tiết chuẩn linh hoạt hơn với việc chỉ lấy tỉ lệ miễn giảm cao nhất. Ví dụ ông A là giảng viên, kiêm chức B (miễn giảm x%), kiêm chức C (miễn giảm x%), kiêm chức D (miễn giảm x%) thì tỉ lệ miễn giảm của A chỉ là x%. Đề xuất: có thể cộng các tỉ lệ miễn giảm nhưng không quá ngưỡng nào đó.\r\n3. Cần có hệ thống giám sát, theo dõi và nhắc nhở sinh viên thường xuyên (hàng tháng thay vì học kì) về ý thức, phương pháp học tập và đặc biệt đối với sinh viên năm nhất để tránh các trường hợp lơ là, chán học, mất định hướng, bỏ học,... để hạn chế cảnh cáo học vụ.\r\n4. Các hoạt động đoàn thể (Công đoàn, Đoàn hội) cần nâng chất và đầu tư kĩ hơn, không chỉ là tham gia/tổ chức cho có để báo cáo, lấy có.\r\n5. Phát triển chất lượng đào tạo từ bên trong, vì lợi ích sinh viên, lấy sinh viên là trung tâm hơn là chạy theo các chuẩn đào tạo, hoạt động kiểm định quốc tế.\r\n6. Việc đăng kí học phần còn quá nhiều bất cập, đặc biệt là ở văn phòng Đặc biệt vì chưa có những phương thức giải quyết vấn đề manh tính quy chuẩn, linh hoạt; đăng kí học phần cho sinh viên CLC còn trì trệ, chưa linh hoạt, khiến sinh viên bối rối, hoang mang, đặc biệt là những môn học lại hoặc cải thiện.\r\n7. Chưa tạo môi trường thi đua trong học tập, NCKH sôi nổi, hiệu quả nhằm kích thích sinh viên tự học, tự khám phát và duy trì đam mê học tập cho sinh viên.\r\n8. Hệ thống khen thưởng còn cức nhắc, chưa linh hoạt và dựa vào quy chế chi tiêu nội bộ là chính. Cần có phương thức khen thưởng kịp thời, linh hoạt để nêu cao những gương sáng, thành tựu điển hình và kích thích mọi người làm việc và phấn đấu hơn.\r\n9. Xây dựng nhiều câu lạc bộ đông về lượng, mạnh về chất để thu hút sinh viên và giúp sinh viên có môi trường tốt phát triển kiến thức, kĩ năng, năng khiếu,... phù hợp nhằm phát triển nhân lực và bồi dưỡng nhân tài, đồng thời giúp xây dựng môi trường giáo dục năng động, sáng tạo, có tính cạnh tranh cao.\r\n10. Liên hệ chặt chẽ với phụ huynh học sinh để giúp phụ huynh nắm bắt kịp thời tình hình học tập, việc đóng học phí, hoạt động phong trào của con em để phụ huynh hỗ trợ nhắc nhở, động viên sinh viên kịp thời.\r\n11. Tổ chức kênh liên hệ cựu sinh viên các hoạt động dành cho cựu sinh viên để cựu sinh có thể gắn bó, đóng góp cho trường, cho các thế hệ sinh viên đàn em.\r\n\r\n\r\n	59998db5-ee85-4321-a7bf-b3d577c4ac03	e2d80b69-b248-48ea-addd-6e1e94cd6f09
