41e1399e-b35b-4f52-b67e-ae6cf0c8f129	0	0	- Tạo điều kiện cho toàn bộ các khoa có PTN để phát triển NCKH và chuyển giao công nghệ. Mặc dù đinh hướng là phát triển thành ĐH nghiên cứu nhưng việc chuyển giao công nghệ cũng rất quan trọng, trường nên quan tâm vấn đề này.\r\n- Cá nhân tôi thấy cán bộ một số phòng ban có trình độ chuyên môn chưa tốt, cụ thể là về mảng quan hệ đối ngoại chúng ta làm khá sơ sài và qua loa. Ví dụ như: tiếp đoàn nước ngoài nhưng chuẩn bị không kĩ, không có cán bộ chuyên trách nên hay đẩy về các khoa tiếp, làm áo trường bằng tiếng Anh để quảng bá nhưng size lớn nhất là XXL form body chỉ bằng áo size L việt nam -> không có ý nghĩa quà tặng cho các giáo sư và khách nước ngoài (thường là size lớn hơn nhiều).\r\n- Về các chương trình đặc biệt, tôi thấy mô hình tổ chức hiện tại chưa hợp lý. Cụ thể là chương trình đào tạo do các khoa xây dựng lên, tuy nhiên việc phân bố giảng viên, mời giảng lại do văn phòng đặc biệt điều phối, điều này khiến cho các khoa không đảm bảo được việc giảng dạy về mặt kiến thức (do mời giảng viên không phù hợp - tương tác giữa giảng viên các môn kém - không quản lý được các phần nội dung trọng tâm cần truyền tải), bên cạnh đó có nhiều việc lẽ ra khoa không cần phụ trách mà lại bị đẩy việc lên (đại loại như thiết kế tờ rơi, bản quảng cáo cho tuyển sinh các chương trình đặc biệt - lẽ ra VPĐB nên làm để đồng bộ hóa giữa các khoa trong trường). Tôi chưa có đề xuất cụ thể, nhưng mong nhà trường xem xét lại về mô hình quản lý.\r\n- Trong các nhiệm vụ của nghiên cứu viên, số tiết nckh 1 năm là nhiều, tuy nhiên hiện tại tôi chưa thấy có mục tính tiết nghiên cứu cho NCV thực tập tại nước ngoài. Tôi nghĩ điều này rất nên, nhằm khuyến khích NCV đi học hỏi, thực nghiệm ngoài nước.\r\n- Hiện tại, tôi thấy vai trò của Công Đoàn chưa rõ rệt, có nhiều cán bộ, nhân viên không biết vai trò của Công Đoàn là gì. Các phong trào thể dục thể thao, văn hóa nghệ thuật của trường hiện đang theo mô hình đầu tư ồ ạt ngắn hạn nên chưa đem lại hiệu quả rõ rệt. Theo tôi nên có kế hoạch dài hạn, đầu tư trọng điểm vào 1 số nội dung văn hóa nghệ thuật, thể thao, thành lập các nhóm mạnh và đầu tư lâu dài.\r\n	59998db5-ee85-4321-a7bf-b3d577c4ac03	d9899bbf-7057-4cfd-96e3-4301a3ad4fc6
