0fae6532-f159-4694-bb7f-eea1de7f9bb5	0	0	Về mặt bằng chung thì trường tốt, hoạt động ổn định, nếu giải quyết được các vấn đề sau thì tương lai UIT sẽ vươn xa.\r\n\r\n1. Cần xây dựng các qui trình đúng chuẩn phục vụ cho các công việc diễn ra có chu kỳ giữa các đơn vị trong trường với nhau. Qui trách nhiệm cá nhân/tập thể nếu làm sai/trễ tiến độ chung công việc của TỔ-CHỨC.\r\n\r\n2. Xây dựng các khóa đào tạo nâng cao về kỹ năng quản lý đúng qui định/qui trình (chỉ cần đúng, không cần sáng tạo) dành cho đối tượng Trưởng/Phó đơn vị để tránh việc vận hành sai/không hiệu quả bộ máy của Tổ chức, gây ảnh hưởng chung.\r\n\r\n3. Đưa hệ số năng suất làm việc vào khen thưởng định kỳ, hoặc khen thưởng tài chính nếu thực hiện nhanh tiến độ công việc được giao.\r\n\r\n4. Tổ chức các khóa học cho giảng viên, nhân viên... về thái độ phục vụ tận tâm đối với SV và đồng nghiệp, vì mục đích phát triển chung.\r\n\r\n5. Nên có chính hỗ trợ cho các cá nhân/tập thể đang đóng góp tài, trí, nhiệt huyết cho Trường. \r\n	7d62e764-a64a-47fb-b3cb-428ddd8257d0	a71b22b7-6eec-41ba-8cbc-817ad518a6af
