8e526d23-5a91-4a2c-9fb1-6757ff46245c	0	0	Công tác chi thưởng cho NCKH không hợp lý khi chỉ thưởng khi DƯ tiết NCKH >= 200 tiết. Điều này nghĩa là NCV phải làm gần gấp đôi mức chuẩn (310 tiết) mới được thưởng. Ngoài ra, mức thưởng quá thấp khi dư từ 200->500 tiết thì thưởng là 500 nghìn/ người (mức thưởng NCKH năm 2017, theo công bố của phòng KHCN).\r\n\r\nNếu được, xin kiến nghị trường quy đổi số tiết dư NCKH thành tiền giống như số tiết giảng dạy. \r\n\r\nNếu không được, xin kiến nghị nhà trường có chính sách để NCV có thể bù tiết NCKH giữa các năm. Vì tính chất của các công bố NCKH là không ổn định: năm nay có thể nhiều paper nhưng năm sau có thể không có paper nào. Do đó, đối với nhân viên, đặc biệt là NCV, hy vọng có chính sách bù trù tiết NCKH giữa các năm. VD năm nay dư tiết chuẩn (không được nhận thưởng) nhưng năm sau thiếu tiết chuẩn thì có thể bù qua.	7d62e764-a64a-47fb-b3cb-428ddd8257d0	ee1d4190-736d-47fd-97d1-e3eb3df5b48f
